(function(global){
  'use strict';


  function errorSvg(uri){
    console.log("url= ",uri);
  }

  global.ErrorHandler = function(data){

    var type = data.type;
    var url = data.url;

    if( type !== "network" && type != 'svg2img') return Promise.resolve(null);

    if( type === 'svg2img' ) return errorSvg(data.uri);

    return new Promise(function(resolve,reject){
      resolve("");
    });

  };


})(this);